export class Appointment
{
  id: number = 0;
  doctor_id: number = 0;
  doctor_name: string = '';
  person_id: number = 0;
  person_name: string = '';
  fee: number = 0;
  description:string = '';
  date:string = ''
  time:number = 0;

  constructor(){}
}
